Produkta kods: F719
Piegāde līdz 10 d.d.
Materiāls pielīp pie rāmjiem un pareizi tos aizsargā;
Palīdzēs aizsargāt jūsu brilles no skrāpējumiem;
Iepakojumā: 80 gab.

Produkta kods: G003
Piegāde līdz 10 d.d.
Vienreizlietojamie priekšauti Labor Pro no polietilēna;
Aizsargā apģērbu no spēcīgām krāsvielām vai ķīmiskām vielām;
Kastītē 25 gab.

Produkta kods: G119
Piegāde līdz 10 d.d.
Audumi ir salocīti pa vienam, padarot tos ērti lietojamus;
Izgatavots no sintētiska materiāla;
Iepakojumā: 80 gab .;
Izmēri: 75 cm (garums), 40 cm (platums).

100% dabīgas augstākās kvalitātes krievu matu šķipsnas ar itāļu keratīna kapsulām.
Matu šķipsnas sver 0,7-0,8 gramu. Mati neuzbriest un nelocās.
Ražošanas procesā mati tiek apstrādāti termiski, ķīmiski, bioloģiski, lai likvidētu iespējamās baktērijas.
Ieteikums meistariem:
Izgrieziet keratīna kapsulu tikai pēc vajadzības. Pārmērīga matu izkrišana var izraisīt pieaudzēto matu izkrišanu;
Keratīna kapsulas laušana nav ieteicama;
Krāsojiet matus tikai pēc dažām mazgāšanas reizēm, lai tiktu nomazgāti aizsargslāņi;
Ieteikums klientiem:
Mazgājiet matus zem remdena ūdens, lai krāsa saglabātos ilgāk;
Katras mazgāšanas laikā izmantojiet dziļi mitrinošas maskas;
Izmantojiet pārbaudītus matu kopšanas līdzekļus, kas nesatur sulfātus, sāļus, parabēnus;
Pēc mazgāšanas lietot eļļas, serumus;
Mazāk apmeklēt baseinus – hlors negatīvi ietekmē matus;
Mazināt peldes jūrā  – sāls iespaidā mati izžūst;
Neapmeklējiet saunas;
Izžāvējiet matus, pirms ejat gulēt;
Nekarsējiet matus pie saknēm: matu žāvētājs, taisnotājs, ruļļi
Pareizi kopjot matus, tie var lieliski saglabāties līdz pat 24 mēnešiem.

